import React, { Component } from 'react';

class Room extends Component {

  constructor(props) {
    super(props);
    this.state = {
      roomId: this.props.match.params.id
    }
  }

  render() {
    return(
      <h2>Room  { this.state.roomId }</h2>
    );
  };
};

export default Room;
